column8:
やや小ぶりなフォルムなので、女性にも使いやすいモデルです★<br>
クラシックとモダンを巧みに融合させ、常に新境地を開拓し続けるオプティカルコレクション。<br>
ビジネスシーンはもちろん、タウンユースからお家眼鏡までと幅広いシーンで活躍!!<br>
「RX5184F」は従来のモデルに比べて鼻盛りを高めにとることで
よりフィット感を高めたフルフィットモデルです。<br><br>

フレーム：全幅約126mm　テンプル約145mm　ブリッジ約18mm<br>

素材：プラスチック<br>

レンズ：タテ約38mm　ヨコ約54mm<br>

素材：プラスチック<br>

